package Tests;

public class typecasting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		double a=50.20;
		int b=14;
		int c=(int) a;
		System.out.println("c value (int) "+c);
		double d=(double) b;
		System.out.println("d value(double)"+d);
		

	}

}
